NewspaperEndgame("SUICIDE_THOUGHT","COP FINALLY KILLS HIMSELF","An officer of the RCM ended his own life yesterday with a single shot. His death came as something of a surprise to those who knew him, as he'd threatened to kill himself on many previous occasions.

 "The people who talk about killing themselves all the time aren't usually the ones that do it," said Officer Judit Minot, friend and colleague of the deceased.

 "The job gets to people in different ways," said Officer Mack Torson, another colleague. "Now they're going to start talking about improving counselling services for officers of the RCM again. But, to be honest, I don't think counselling would have helped him."");

NewspaperEndgame("HEART_ATTACK","COP SUFFERS FINAL HEART ATTACK","A detective lieutenant of the RCM passed away yesterday. His death, though abrupt, did not come as a surprise to those who knew him. "He was the heaviest drinker I'd ever met," Captain Ptolemy Pryce, the deceased's superior officer, commented. "That ain't easy on the ticker."

"He loved his liquor, sure," said Detective Chester McLaine, friend and colleague. "But I think before he ever had a heart attack, his heart was broken."

According to an official statement given by the RCM, the officer was on the brink of solving a murder case.");

NewspaperEndgame("MORALIST_QUEST","WEEKS LATER, NO ANSWERS ABOUT EXTRACTED COP","The condition and whereabouts of an RCM lieutenant extracted by a Coalition aerostatic two weeks ago remain unknown. The dramatic manoeuvre, witnessed by dozens near the north roundabout, has reportedly increased tensions between the citizens of Martinaise, the RCM, and Coalition authorities.

Early reports that the lieutenant was investigating entroponetic phenomena along the coast have not been confirmed. 

According to an official statement given by the RCM, the lieutenant was in Martinaise as part of a murder investigation. A Coalition representative declined repeated requests for comment.");

NewspaperEndgame("SPIRIT_BOMB_DRINK","COP SELF-IMMOLATES IN THE STREETS OF MARTINAISE","A detective lieutenant of the RCM went up in flames yesterday after setting a bottle of 197.4 proof alcohol on fire and taking a drink.

 "He moved so quickly and decisively, there was nothing I could do to stop him," said Lieutenant Kitsuragi, who was present at the scene. "I must admit, however, that I was not entirely surprised by this turn of events. He seemed to be going through a lot."

"That's just like him, to take his leave in a fit of theatricality while the rest of us have to clean up the mess," Satellite-Officer Vicquemare commented, referring to the case that the deceased was working on at the time of his death. That case remains unsolved.");

NewspaperEndgame("ISLAND_HEART_ATTACK","HERO COP SUFFERS FINAL HEART ATTACK","A detective lieutenant of the RCM passed away yesterday. His death, though abrupt, did not come as a surprise to those who knew him. "He was the heaviest drinker I'd ever met," Captain Ptolemy Pryce, the deceased's superior officer, commented. "That ain't easy on the ticker."

"He loved his liquor, sure," said Detective Chester McLaine, friend and colleague. "But I think before he ever had a heart attack, his heart was broken."

According to an official statement given by the RCM, the officer was in the middle of extracting a confession from a suspect in a murder investigation at the time. The suspect is now in custody.");
